const SocialMedia = ({ socialaccount }) => {
  const socailMediakey = socialaccount.key;
  const socailMediaValue = socialaccount.value;
  const socialMediaMap = [
    {
      instagram: "",
      facebook: "fab fa-facebook-square></i>",
      youtube: "",
      twitter: "",
    },
  ]; //will move this thing in database later
  return (
    <Fragment>
      <div></div>
    </Fragment>
  );
};

export default SocialMedia;
